import React from "react";

const Footer = (): JSX.Element => {
    return (
        <div>
            {/* footer section start */}
            <footer className="overflow-hidden rounded-b-2xl bg-transparent">
                <p className="text-center py-6 text-gray-lite dark:text-color-910"> © 2023 Tous droits réservés 
                    <a className="hover:text-[#FA5252] duration-300 transition"
                                   href="https://themeforest.net/user/ib-themes" target="_blank"
                                   rel="noopener noreferrer"> ib-themes</a>. </p>
            </footer>
            {/* footer section end */}
        </div>
    )
}

export default Footer
